import "../css/list.css";
import Button from "./Button";

function List({ item }) {
  const {product, quentity, packed } = item;

  return (
    <li className="listWrapper">
      <span>{ quentity }</span>
      <p style={ packed ? { textDecoration: "line-through" } : {} }>{ product }</p>
      <div>
        <Button content="Done"   className="doneBtn"/>
        <Button content="Delete" className="deleteBtn"/>
      </div>
    </li>
  );
}
export default List;
